import React from 'react';
import '../App.css';
import Grid from '@mui/material/Grid';
import { useNavigate, Navigate, Link } from 'react-router-dom';
// import axios from 'axios';
import {
  Typography,
  Container,
  List,
  ListItem,
  Divider,
  ListItemText,
  ListItemButton,
} from '@mui/material';
import { styled, useTheme } from '@mui/system';
import { createTheme } from '@mui/material/styles';

import projectsData from '../data/ProjectsData';

const ProgButton = styled('button')({
  backgroundColor: '#0171e3',
  width: '430px',
  height: '50px',
  margin: '10px',
  color: 'white',
  padding: '5px 10px',
  border: 'none',
  borderRadius: '5px',
  alignSelf: 'center',
  cursor: 'pointer',
});

const Box = styled('div')({
  display: 'flex',
  height: '100%',
  border: '1px solid #6D8472',
  borderRadius: '15px',
  padding: '10px'
});

const ProjectsSection = styled('div')({
  display: 'flex',
  height: '100%',
})

const Item = styled('div')({
  display: 'flex',
  flexDirection: 'column',
  padding: '10px',
});

const ProjectsBox = ({ id, title, description }) => (
    <Item className="subscription-head" id={id}>
      <Typography sx={{ fontSize: "2rem", fontWeight: "500" }}>
        {title}
      </Typography>
      <Typography sx={{ fontSize: ".875rem" }}>
        {description}
      </Typography>
    </Item>
)

function Projects({ token, setTokenFunction }) {
  const navigate = useNavigate();
  const theme = useTheme();

  const goToCart = () => {
    navigate('/cart')
  }

  return <>
    <div sx={{ display: "flex", flexDirection: "column", alignContent: "center", justifyContent: "center"}}>
      <Container component="main" maxWidth="md" sx={{ display: "flex", flexDirection:"column", paddingBottom: "50px" }}>
      </Container>
      <Grid
        sx={{
          flexGrow: 1, height: "700px",
          px: { xs: "50px", md: "100px" }
        }}
        container spacing={2}
      >
        <Grid item xs={8}>
          <Typography sx={{ fontSize: "1rem", color: "#a7a396" }}>
            Step <b>2</b> of <b>3</b>
          </Typography>
          <Typography sx={{ fontSize: "2rem", fontWeight: "500" }}>
            Choose Projects
          </Typography>
          <Box sx={{ height: "80%" }}>

          </Box>
        </Grid>
        <Grid item xs={4}>
          <Typography id="empty-spacer1" sx={{ fontSize: "1rem", color: "#a7a396" }}>
            &nbsp;
          </Typography>
          <Typography id="empty-spacer2" sx={{ fontSize: "2rem", fontWeight: "500" }}>
            &nbsp;
          </Typography>
          <ProjectsSection sx={{ height: "80%", flexDirection:"column", padding:"0" }}>
            <Typography sx={{ fontSize: "2rem", fontWeight: "500" }}>
              Projects.
              <Typography component="span" sx={{ fontSize: "2rem", fontWeight: "500", color: "#a7a396" }}>
                Which interests you?
              </Typography>
            </Typography>
            {projectsData.map((projects) =>(
              <ProjectsBox key={projects.id} {...projects} />
            ))}
            <button type="checkbox">
              Add all to cart?
            </button>
          </ProjectsSection>
        </Grid>
      </Grid>
      <div style={{ display: 'flex', justifyContent: 'center', width: '100%' }}>
        <ProgButton onClick={goToCart}>Next</ProgButton>
      </div>
    </div>
  </>
}

export default Projects;
